		$(".qz-pglb-sm5 a.login-in").click(function(){
			//登录方法
			var l_phone = $('#l_phone').val();
			var l_password = $('#l_password').val();
			var l_code = $('#l_code').val();
			$.ajax ({
				url: '/activity/login',
				type: "POST",
				data: {l_phone:l_phone,l_password:l_password,l_code:l_code},
				dataType: "json",
				success: function(data){
					//var ret = eval('(' + data + ')');	
					var ret = data;
					if(ret.error == 0){
						window.location.href="/activity/act20160405";						
					}else if(ret.error == -1){
						alert(ret.msg);
						return false;
					}else{
						alert('用户名或密码错误');
						return false;
					}
				}
			});
		})
		//注册--
		$(".qz-pglb-sm6 i").click(function(){$(this).closest(".qz-pglb-sm6").hide()&&$(".mask").hide();})
		// 验证码倒计时
	    var validCode=true;
		$(".logup-bcode").on("click",function(){		
			
			//按钮倒计时方法
			var time=60;
			var code=$(this);
			if(validCode){
				var phone = $('#phone').val();
				//发送验证码到手机的执行方法
				if(phone == ''){
					alert('手机号不能为空');
					return false;
				}else{
					//密码的验证规则
					reg = /^1[34758]{1}\d{9}$/;
					if(!reg.test(phone)){
						alert('手机号格式不对，请重新填写');
						return false;
					}
					$.post(
						'/activity/send_yzm',
						{
							phone:$('#phone').val()
						},
						function(msg){
							if(msg == 0){
								alert('发送失败,请重新填写');
								return false;
							}else if(msg == 1){
								alert('发送成功');
							}else if(msg == -1){
								alert('该号码已经注册过了，请直接登录');
								return false;
							}
						}
					);
				}
				
				validCode=false;
				var t=setInterval(function(){
					time--;
					code.html("重新发送("+time+")");
					code.addClass("m-on");
					if (time==0) {
						clearInterval(t);
						code.html("获取验证码");
						validCode=true;
						code.removeClass("m-on");
					 }
				},1000);
			}
		})
		
        //注册成功消失		
	    $(".qz-pglb-sm6 a.login-up-btn").click(function(){
		
			var phone = $.trim($('#phone').val());
			var code = $.trim($('#code').val());	
			var password = $.trim($('#password').val());
			var reg_pwd = $.trim($('#reg_pwd').val());
			//各个填项的长度
			var len2 = password.length;
			//验证所有填项是否为空
			if(phone==''||code==''||password==''||reg_pwd==''){
				alert('所有选项均为必填项，请重新填写');
				return false;
			}else{
				//密码的验证规则
				reg2=/^[a-z,A-Z]+[0-9]*[a-z,A-Z]*[0-9]*$/;
				if(!reg2.test(password)){
					alert('密码应为大小写英文和数字');
					return false;
				}else{
					if(len2<6||len2>16){
						alert('密码的长度为6-12个字符，请重新填写');
						return false;
					}
				}
				//验证确认密码和密码是否一致
				if(password != reg_pwd){
					alert('两次输入密码不一致');
					return false;
				}
			
			}
			$.post(
				'/activity/add_user',
				{
					phone:phone,
					code:code,
					password:password,
					reg_pwd:reg_pwd
				},
				function(data){
					var ret = eval('(' + jQuery.parseJSON(data) + ')');
					if(ret.error == 0){
						$(".qz-pglb-sm6").hide()&&$(".mask").hide();
						alert('注册成功');
					}else{
						alert(ret.msg);
						return false;
					}
				}
			);
				
		})		
