					jQuery(".qz-pglb-sm4-txt").slide({mainCell:".bd .bdList",autoPage:"<li><a>$</a></li>",effect:"leftLoop",autoPlay:true,prevCell:".qz-pglb-sm4-prev",nextCell:".qz-pglb-sm4-next",pageStateCell:".qz-pglb-sm4-page0"});

					$(".qz-pglb-sm4-txt .qz-pglb-sm4-kz").trigger("click");
